import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Notes from "./Notes";
import notes from "../notes"
import CreateArea from "./CreateArea";


function App(){
   return (<>
   <Header /> 
   <CreateArea />
   {notes.map(function createNotes(e){
   return <Notes 
      
      title={e.title}
      
      content={e.content}
    />
    
})}
   
   
   <Footer />
   </>)
}
export default App;
